import * as React from 'react';
import { styled, useTheme } from '@mui/material/styles';
import Box from '@mui/material/Box';
import Drawer from '@mui/material/Drawer';
import CssBaseline from '@mui/material/CssBaseline';
import MuiAppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import List from '@mui/material/List';
import Typography from '@mui/material/Typography';
import Divider from '@mui/material/Divider';
import IconButton from '@mui/material/IconButton';
import MenuIcon from '@mui/icons-material/Menu';
import ChevronLeftIcon from '@mui/icons-material/ChevronLeft';
import ChevronRightIcon from '@mui/icons-material/ChevronRight';
import ListItem from '@mui/material/ListItem';
import ListItemIcon from '@mui/material/ListItemIcon';
import ListItemText from '@mui/material/ListItemText';
import InboxIcon from '@mui/icons-material/MoveToInbox';
import MailIcon from '@mui/icons-material/Mail';

import {Grid,Paper} from "@mui/material"
import { APPLICATION_NAME } from '../Constant/Constant';

const drawerWidth = 240;

const Main = styled('main', { shouldForwardProp: (prop) => prop !== 'open' })(
  ({ theme, open }) => ({
    flexGrow: 1,
    padding: theme.spacing(3),
    transition: theme.transitions.create('margin', {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.leavingScreen,
    }),
    marginLeft: `-${drawerWidth}px`,
    ...(open && {
      transition: theme.transitions.create('margin', {
        easing: theme.transitions.easing.easeOut,
        duration: theme.transitions.duration.enteringScreen,
      }),
      marginLeft: 0,
    }),
  }),
);

const AppBar = styled(MuiAppBar, {
  shouldForwardProp: (prop) => prop !== 'open',
})(({ theme, open }) => ({
  transition: theme.transitions.create(['margin', 'width'], {
    easing: theme.transitions.easing.sharp,
    duration: theme.transitions.duration.leavingScreen,
  }),
  ...(open && {
    width: `calc(100% - ${drawerWidth}px)`,
    marginLeft: `${drawerWidth}px`,
    transition: theme.transitions.create(['margin', 'width'], {
      easing: theme.transitions.easing.easeOut,
      duration: theme.transitions.duration.enteringScreen,
    }),
  }),
}));

const DrawerHeader = styled('div')(({ theme }) => ({
  display: 'flex',
  alignItems: 'center',
  padding: theme.spacing(0, 1),
  // necessary for content to be below app bar
  ...theme.mixins.toolbar,
  justifyContent: 'flex-end',
}));

export  function AppbarComponent({menuList}) {
  const theme = useTheme();
  const [open, setOpen] = React.useState(false);

  const handleDrawerOpen = () => {
    setOpen(true);
  };

  const handleDrawerClose = () => {
    setOpen(false);
  };

  return (
    <Box sx={{ display: 'flex' }}>
      <CssBaseline />
      <AppBar position="fixed" open={open}>
        <Toolbar>
          <IconButton
            color="inherit"
            aria-label="open drawer"
            onClick={handleDrawerOpen}
            edge="start"
            sx={{ mr: 2, ...(open && { display: 'none' }) }}
          >
            <MenuIcon />
          </IconButton>
          <Typography variant="h6" noWrap component="div">
            {APPLICATION_NAME}
          </Typography>
        </Toolbar>
      </AppBar>
      <Drawer
        sx={{
          width: drawerWidth,
          flexShrink: 0,
          '& .MuiDrawer-paper': {
            width: drawerWidth,
            boxSizing: 'border-box',
          },
        }}
        variant="persistent"
        anchor="left"
        open={open}
      >
        <DrawerHeader>
          <IconButton onClick={handleDrawerClose}>
            {theme.direction === 'ltr' ? <ChevronLeftIcon /> : <ChevronRightIcon />}
          </IconButton>
        </DrawerHeader>
        <Divider />
          <List>
            {
              menuList.map(menu=>{
                let highLight=false
                if (window.location.hash.includes(menu.url)) {
                  highLight = true
                }
                else {
                  highLight = false
                }
               return( 
                menu.children.length!==0?
               <ExpansionCompoent icon={menu.icon} highlight={highLight ? "highlight" : "url"} classes={props.classes} css={css} submenu={data[i].children} id={data[i].title} />
                :
                <h6 className={props.classes.menuBar}>

                  <Link style={css} href={data[i].url}>
                    <i style={{ "padding-left": '23px' }} className="iconmenubar">{data[i].icon}</i>
                    <span className={highlight ? classes.highlight : classes.urlStyle} >{data[i].title}</span>
                  </Link>
                </h6>
               )
            }
            )

            }
          </List>
        <List>
          {['Inbox', 'Starred', 'Send email', 'Drafts'].map((text, index) => (
            <ListItem button key={text}>
              <ListItemIcon>
                {index % 2 === 0 ? <InboxIcon /> : <MailIcon />}
              </ListItemIcon>
              <ListItemText primary={text} />
            </ListItem>
          ))}
        </List>
        <Divider />
        <List>
          {['All mail', 'Trash', 'Spam'].map((text, index) => (
            <ListItem button key={text}>
              <ListItemIcon>
                {index % 2 === 0 ? <InboxIcon /> : <MailIcon />}
              </ListItemIcon>
              <ListItemText primary={text} />
            </ListItem>
          ))}
        </List>
      </Drawer>
      <Main open={open}>
        <DrawerHeader />
        <Grid container spacing={1}>
                    {menuList.map(menu=>
                        <Grid item xs={12} sm={4}>
                            <Paper className="paper text-center">
                                <span >
                                    {menu.icon}
                                </span>
                                <div>
                                    {menu.title}
                                </div>
                            </Paper>
                        </Grid>                    
                    ) 

                    }

            </Grid>
      </Main>
    </Box>
  );
}
function ExpansionCompoent(props) {
  const classes = useStyles();
  return <ExpansionPanel className={"expand-detail"}>
    <ExpansionPanelSummary
      expandIcon={<ExpandMoreIcon />}
      id={props.id}
      aria-controls={props.title}
    >
      <Typography style={{ 'display': 'flex' }} component="span">
        <i className="iconmenubar">{props.icon}</i>
        <span className={"menu-title"} id="urltab">{props.id}</span>
      </Typography>

    </ExpansionPanelSummary>
    <ExpansionPanelDetails className={classes.expansionDetails}>
      <List>
        {props.submenu.map(menu =>
          <ListItem className={classes.submenu}>
            <ListItemText >
              <Link href={menu.url} >
                {menu.title}
              </Link>
            </ListItemText>
          </ListItem>
          // {/* {menu.title} */}
        )}
      </List>
    </ExpansionPanelDetails>
  </ExpansionPanel>
}
